angular.module('starter.services')

.service('ImageSvc', function($q, $cordovaCamera) {
    var self = this;
    self.currentImage = {};
    self.getImage = _getImage;
    
    function _getImage(useLibrary) {
        var options = {
          quality: 80,
          destinationType: Camera.DestinationType.FILE_URI,
          sourceType: (useLibrary==0)?Camera.PictureSourceType.CAMERA:Camera.PictureSourceType.PHOTOLIBRARY,
          allowEdit: false,
          encodingType: Camera.EncodingType.JPEG,
          targetWidth: 850,
          targetHeight: 1100,
          saveToPhotoAlbum: false
        };
        
        //kickoff the picture takings (camera or library)
        return $cordovaCamera.getPicture(options)
        .then(function(imageData) {
            //placeholder for now to allow passing thru the promise chain...
            self.currentImage.imageData = imageData;
            return _getImageFileEntry(imageData)
        }).then(function(fileEntry) {
            self.currentImage.imageFileEntry = fileEntry;            
            return _getImageFile(fileEntry);
        }).then(function(file) {
            self.currentImage.imageFile = file;            
            self.currentImage.imageId = 'img_' + moment().format('YYYYMMDD.hhmmss.SSS');
            return true;
        }).catch(function(error) {
            console.error('_takePicture error: ' + error);
            return false;
        });        
    }
    
    function _getImageFileEntry(fileUri) {        
        return $q(function(resolve, reject) {
            window.resolveLocalFileSystemURI(fileUri,function(fileEntry) {
                resolve(fileEntry);
            }, function(error) {
                reject(error);
            });
        });
    }
    
    function _getImageFile(fileEntry) {        
        return $q(function(resolve, reject) {
            fileEntry.file(function(file) {
                resolve(file);
            }, function(error) {
                reject(error);
            });
        });
    }    
    
    self.images = [
"data:image/jpg;base64,",
        
"data:image/png;base64,",
        
"data:image/jpg;base64,"];
        
    return self;
})
